import Layout from "../components/Layout";
import Form from "../components/Form";
import React from "react";
import Table from "../components/Table";
import Chart from "../components/Chart";

const api_url =
  "https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan";

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      jsonObjec: null,
      response: null,
    };
  }

  handleSubmit = (laanDetaljer) => {
    this.setState({ jsonObjec: laanDetaljer });
    fetch(api_url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(laanDetaljer),
    })
      .then((res) => res.json())
      .then((result) => {
        console.log(JSON.stringify(result));
        this.setState({ response: result });
      });
  };

  render() {
    return (
      <Layout>
        <div className="container">
          <Form handleSubmit={this.handleSubmit} />
        </div>
        <div>
          <div class="row">
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
          </div>
          <div class="row">
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col-sm" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
          </div>
          <Chart />
        </div>
      </Layout>
    );
  }
}

export default Index;
